    public static func read(from buf: inout (data: Data, offset: Data.Index)) throws -> DidMethod {
        let variant: Int32 = try readInt(&buf)
        switch variant {
        
        case 1: return .tdw(scid: try FfiConverterString.read(from: &buf), httpsUrl: try FfiConverterString.read(from: &buf)
        )
        
        case 2: return .webvh(scid: try FfiConverterString.read(from: &buf), httpsUrl: try FfiConverterString.read(from: &buf)
        )
        
        case 3: return .unknown
        
        default: throw UniffiInternalError.unexpectedEnumCase
        }
    }

