        switch value {
        
        
        case let .tdw(scid,httpsUrl):
            writeInt(&buf, Int32(1))
            FfiConverterString.write(scid, into: &buf)
            FfiConverterString.write(httpsUrl, into: &buf)
            
        
        case let .webvh(scid,httpsUrl):
            writeInt(&buf, Int32(2))
            FfiConverterString.write(scid, into: &buf)
            FfiConverterString.write(httpsUrl, into: &buf)
            
        
        case .unknown:
            writeInt(&buf, Int32(3))
        
        }
    }
}


